import ReturnNavArray from "./ReturnNavArray";
import docNavData from "./docNavData";

interface Props {
  userType: string;
  passLinks: (links: string[]) => void;
  passLabels: (labels: string[]) => void;
  passRoutes: (routes: React.ReactElement[]) => void;
}

const Login = ({ userType, passLinks, passLabels, passRoutes }: Props) => {
  const handleLinks = (input: string[]) => {
    passLinks(input);
    console.log(input);
  };

  const handleRoutes = (input: React.ReactElement[]) => {
    passRoutes(input);
  };

  const onClick = () => {
    passLinks(docNavData.headerLinks);

    return <></>;
  };

  return (
    <main
      className="govuk-main-wrapper app-main-class"
      id="main-content"
      role="main"
    >
      <h1 className="govuk-heading-xl">{userType} Login Page</h1>

      <div className="govuk-form-group">
        <label className="govuk-label" htmlFor="nameLog">
          Name
        </label>
        <input
          className="govuk-input govuk-input--width-10"
          id="nameLog"
          name="nameLog"
          type="text"
        />
      </div>
      <div className="govuk-form-group">
        <label className="govuk-label" htmlFor="passwordLog">
          Password
        </label>
        <input
          className="govuk-input govuk-input--width-10"
          id="passwordLog"
          name="passwordLog"
          type="text"
        />
      </div>
      <button
        className="govuk-button"
        data-module="govuk-button"
        onClick={onClick}
      >
        Submit
      </button>
    </main>
  );
};

export default Login;
